import React from "react";

const ReportCard = ({ report }) => {
  return (
    <div className="card">
      <h3>{report.name}</h3>
      <p><strong>Category:</strong> {report.category}</p>
      <p><strong>Created:</strong> {new Date(report.createdAt).toLocaleDateString()}</p>
    </div>
  );
};

export default ReportCard;
